create table users
(
    id              bigint unsigned auto_increment comment '用户 id'
        primary key,
    username        varchar(100)            not null comment '用户名',
    password        varchar(100)            not null comment '密码',
    nickname        varchar(100) default '' not null comment '用户昵称',
    pay_password    varchar(100) default '' not null comment '支付密码',
    mobile          varchar(20)  default '' not null comment '手机号',
    signature       varchar(255) default '' not null comment '签名',
    last_login_ip   varchar(45)  default '' not null comment '最后登录 ip 地址',
    last_login_port int unsigned default 0  not null comment '最后登录端口',
    register_ip     varchar(45)  default '' not null comment '注册ip',
    register_port   int unsigned default 0  not null comment '注册端口',
    register_reason varchar(50)  default '' not null comment '注册原因',
    reject_reason   varchar(100) default '' not null comment '审核拒绝原因',
    username_bout   int unsigned default 0  not null comment '用户名修改次数',
    thread_count    int unsigned default 0  not null comment '主题数',
    follow_count    int unsigned default 0  not null comment '关注数',
    fans_count      int unsigned default 0  not null comment '粉丝数',
    liked_count     int unsigned default 0  not null comment '点赞数',
    question_count  int unsigned default 0  not null comment '提问数',
    status          tinyint      default 0  not null comment '用户状态：0正常 1禁用 2审核中 3审核拒绝 4审核忽略',
    avatar          varchar(255) default '' not null comment '头像地址',
    background      varchar(255) default '' not null comment '背景图地址',
    identity        char(18)     default '' not null comment '身份证号码',
    realname        varchar(20)  default '' not null comment '身份证姓名',
    avatar_at       datetime                null comment '头像修改时间',
    login_at        datetime                null comment '最后登录时间',
    joined_at       datetime                null comment '付费加入时间',
    expired_at      datetime                null comment '付费到期时间',
    created_at      datetime                not null comment '创建时间',
    updated_at      datetime                not null comment '更新时间',
    bind_type       tinyint      default 0  not null comment '登录绑定类型；0：默认或微信；2：qq登录；',
    constraint users_username_unique
        unique (username)
)
    collate = utf8mb4_unicode_ci
    auto_increment = 144;

create index nickname
    on users (nickname);

